// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;
pragma abicoder v2;

import {PaymentIntent, PaymentIntentHookData} from "../Structs.sol";

interface IPaymentHook {
    /// @notice Executes the payment intent hook
    /// @param _nonce The nonce of the cctp burn message
    /// @param _version The version of the cctp burn message
    /// @param _burnToken The token that was burned
    /// @param _mintRecipient The address that received the mint
    /// @param _amount The amount of the payment intent
    /// @param _messageSender The address that sent the message
    /// @param _maxFee The maximum fee that was executed
    function executePaymentHook(
        bytes32 _nonce,
        uint32 _version,
        bytes32 _burnToken,
        bytes32 _mintRecipient,
        uint256 _amount,
        bytes32 _messageSender,
        uint256 _maxFee,
        uint256 _feeExecuted,
        uint256 _expirationBlock,
        PaymentIntentHookData memory _paymentData
    ) external returns (bool);

    function hashPaymentIntent(
        PaymentIntent memory _intent
    ) external view returns (bytes32);
}

contracts/interfaces/ISwapTarget.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;

interface ISwapTarget {
    /// @notice Executes the swap hook
    /// @param _tokenIn The token that was burned
    /// @param _tokenOut The token that was minted
    /// @param _amountInMax The maximum amount of tokens that were burned
    /// @param _amountOutMin The minimum amount of tokens that were minted
    /// @param _structData The struct data for the swap
    /// @return success Whether the swap was successful
    function executeSwapHook(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountInMax,
        uint256 _amountOutMin,
        bytes calldata _structData
    ) external returns (bool);

    event BurnHookExecuted(
        uint256 amount,
        uint32 destinationDomain,
        bytes32 mintRecipient,
        address burnToken,
        bytes32 destinationCaller,
        uint256 maxFee,
        uint32 minFinalityThreshold,
        bytes hookData
    );
}

contracts/PaymentIntentHandler.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;
pragma abicoder v2;

import {SafeERC20} from "../lib/evm-cctp-contracts/lib/openzeppelin-contracts/contracts/token/ERC20/SafeERC20.sol";
import {ReentrancyGuard} from "../lib/evm-cctp-contracts/lib/openzeppelin-contracts/contracts/utils/ReentrancyGuard.sol";
import {AccessControl} from "../lib/evm-cctp-contracts/lib/openzeppelin-contracts/contracts/access/AccessControl.sol";
import {SafeMath} from "../lib/evm-cctp-contracts/lib/openzeppelin-contracts/contracts/math/SafeMath.sol";
import {IERC20} from "../lib/evm-cctp-contracts/lib/openzeppelin-contracts/contracts/token/ERC20/IERC20.sol";

import {IPaymentHook} from "./interfaces/IPaymentHook.sol";
import {ISwapTarget} from "./interfaces/ISwapTarget.sol";
import {Signatures} from "./Signatures.sol";
import {PaymentIntentHookData, PaymentIntent, QuantityType, SignerType} from "./Structs.sol";

/// @notice Payment intent processor for Circle CCTP V2
contract PaymentIntentHandler is
    IPaymentHook,
    ISwapTarget,
    Signatures,
    ReentrancyGuard,
    AccessControl
{
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    bytes32 public constant OPERATOR_ROLE = keccak256("OPERATOR_ROLE");

    /// @notice Tracks used orders to prevent replays
    mapping(bytes32 => bool) public orderIds;

    /// @notice Tracks used salts to prevent replays
    mapping(uint256 => uint256) public usages;

    /// @notice Tracks used nonces to prevent replays
    mapping(uint256 => uint256) public nonces;

    /// @notice Tracks deactivated intents
    mapping(address => mapping(uint256 => bool)) public deactivated;

    /// @notice USDC token address on this chain
    address public usdc;

    /// @notice The address of the CCTP hook wrapper
    address public hookWrapper;

    /// @notice Emitted upon succesful consumption of payment intent
    event PaymentIntentSuccess(
        bytes32 indexed consumptionNonce,
        bytes32 indexed orderId,
        PaymentIntent intent,
        uint256 feeExecuted,
        uint256 netMinted,
        uint256 netPayable,
        uint256 netFee,
        uint256 quantityUsed
    );

    /// @notice Emitted when the nonce of an intent is updated
    event PaymentIntentNonceUpdated(uint256 indexed salt, uint256 nonce);

    /// @notice Emitted when an intent is deactivated
    event PaymentIntentDeactivated(uint256 indexed salt, bool deactivate);

    /// @notice Initializes the contract with the USDC and Circle Messenger addresses
    constructor(address _usdc, address _hookWrapper) Signatures() {
        require(_usdc != address(0), "Invalid USDC address");
        require(_hookWrapper != address(0), "Invalid hook wrapper address");

        usdc = _usdc;
        hookWrapper = _hookWrapper;

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    /// @notice Deactivate a payment intent
    /// @param _salt The salt of the payment intent
    /// @param _deactivate Whether to deactivate the payment intent
    function toggleDeactivate(uint256 _salt, bool _deactivate) external {
        deactivated[msg.sender][_salt] = _deactivate;
        emit PaymentIntentDeactivated(_salt, _deactivate);
    }

    function validateIntent(
        bytes32 _orderId,
        PaymentIntent memory _intent,
        bytes memory _signature
    ) external {
        _validateIntent(_orderId, _intent, _signature);
    }

    /// @notice locally fulfill a payment intent
    /// @param _orderId The order ID of the payment intent
    /// @param _intent The payment intent to fulfill
    /// @param _signature The signature of the payment intent
    function fulfillIntent(
        bytes32 _orderId,
        PaymentIntent memory _intent,
        bytes memory _signature
    ) external nonReentrant returns (bool) {
        return 
            _fulfillIntent(
                bytes32(0),
                0, 
                _orderId, 
                _intent,
                _signature
            );
    }

    /// @inheritdoc ISwapTarget
    function executeSwapHook(
        address /*_tokenIn*/,
        address /*_tokenOut*/,
        uint256 /*_amountInMax*/,
        uint256 /*_amountOut*/,
        bytes calldata _structData
    ) external override nonReentrant returns (bool) {
        PaymentIntentHookData memory _paymentData = abi.decode(
            _structData,
            (PaymentIntentHookData)
        );

        return
            _fulfillIntent(
                bytes32(0),
                0,
                _paymentData.orderId,
                _paymentData.intent,
                _paymentData.signature
            );
    }

    /// @inheritdoc IPaymentHook
    function executePaymentHook(
        bytes32 _nonce,
        uint32 /* _version */,
        bytes32 /* _burnToken */,
        bytes32 /* _mintRecipient */,
        uint256 /* _amount */,
        bytes32 /* _messageSender */,
        uint256 /* _maxFee */,
        uint256 _feeExecuted,
        uint256 /* _expirationBlock */,
        PaymentIntentHookData memory _paymentData
    ) external override nonReentrant onlyHookWrapper returns (bool) {
        return
            _fulfillIntent(
                _nonce,
                _feeExecuted,
                _paymentData.orderId,
                _paymentData.intent,
                _paymentData.signature
            );
    }

    /// @notice locally fulfill a payment intent
    /// @param _feeExecuted The fee executed
    /// @param _orderId The order ID of the payment intent
    /// @param _intent The payment intent to fulfill
    /// @param _signature The signature of the payment intent
    function _fulfillIntent(
        bytes32 _consumptionNonce,
        uint256 _feeExecuted,
        bytes32 _orderId,
        PaymentIntent memory _intent,
        bytes memory _signature
    ) internal returns (bool) {
        _consumeIntent(_orderId, _intent, _signature);

        uint256 netMinted = _intent.amount - _feeExecuted;
        uint256 grossFee = _intent.amount.mul(_intent.feeBps).div(10_000);
        uint256 netPayable = _intent.amount - grossFee;

        require(netMinted > netPayable, "Underfunded intent");

        IERC20(usdc).safeTransferFrom(
            msg.sender,
            _intent.merchant,
            netPayable
        );

        if (netMinted > netPayable) {
            IERC20(usdc).safeTransferFrom(
                msg.sender,
                _intent.feeRecipient,
                netMinted - netPayable
            );
        }

        emit PaymentIntentSuccess(
            _consumptionNonce,
            _orderId,
            _intent,
            _feeExecuted,
            netMinted,
            netPayable,
            netMinted - netPayable,
            usages[_intent.salt]
        );

        return true;
    }

    /// @notice Consume an intent by checking the nonce, quantity, and signature
    /// @param _intent The intent to consume
    /// @param _signature The signature of the intent
    function _consumeIntent(
        bytes32 _orderId,
        PaymentIntent memory _intent,
        bytes memory _signature
    ) internal {
        _validateIntent(_orderId, _intent, _signature);

        orderIds[_orderId] = true;

        // check the current nonce of the intent and update if it's higher
        if (_intent.nonce > nonces[_intent.salt]) {
            nonces[_intent.salt] = _intent.nonce;
            emit PaymentIntentNonceUpdated(_intent.salt, _intent.nonce);
        }

        usages[_intent.salt] = usages[_intent.salt] + 1;
    }

    /// @notice Validate a payment intent
    /// @param _orderId The order ID of the payment intent
    /// @param _intent The payment intent to validate
    /// @param _signature The signature of the payment intent
    function _validateIntent(
        bytes32 _orderId,
        PaymentIntent memory _intent,
        bytes memory _signature
    ) internal {
        require(
            !deactivated[_intent.merchant][_intent.salt],
            "Intent deactivated"
        );

        require(
            !orderIds[_orderId], 
            "Order ID already used"
        );

        // check the current nonce of the intent
        uint256 currentNonce = nonces[_intent.salt];
        require(
            _intent.nonce == currentNonce || _intent.nonce > currentNonce,
            "Using old intent nonce"
        );

        // check if the payment intent has been used
        uint256 usage = usages[_intent.salt];
        if (_intent.quantityType == QuantityType.FIXED) {
            require(usage < _intent.quantity, "Quantity already used");
        }

        // verify the intent signature by the merchant
        bytes32 _hash = _hashPaymentIntent(_intent);
        address signer = _resolveIntentSigner(_intent);
        _verifySignature(_hash, signer, _signature);
    }

    /// @inheritdoc IPaymentHook
    function hashPaymentIntent(
        PaymentIntent memory intent
    ) external override view returns (bytes32) {
        return _hashPaymentIntent(intent);
    }

    /// @notice Resolve the signer of the intent
    /// @param _intent The intent to resolve the signer for
    /// @return signer The signer of the intent
    function _resolveIntentSigner(
        PaymentIntent memory _intent
    ) internal view returns (address) {
        if (_intent.signerType == SignerType.MERCHANT) {
            return _intent.merchant;
        } else if (_intent.signerType == SignerType.OPERATOR) {
            require(hasRole(OPERATOR_ROLE, _intent.signer), "Invalid operator");
            return _intent.signer;
        } else {
            revert("Invalid signer type");
        }
    }

    modifier onlyHookWrapper() {
        require(msg.sender == hookWrapper, "Only callable by hook wrapper");
        _;
    }
}

contracts/Signatures.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;
pragma abicoder v2;

import {PaymentIntent} from "./Structs.sol";

interface IERC1271 {
    function isValidSignature(
        bytes32 hash,
        bytes calldata signature
    ) external view returns (bytes4);
}

contract Signatures {
    bytes32 private constant _ERC6492_DETECTION_SUFFIX =
        0x6492649264926492649264926492649264926492649264926492649264926492;

    bytes32 private _EIP_712_DOMAIN_TYPEHASH;

    bytes32 private _PAYMENT_INTENT_TYPEHASH;

    string private constant _NAME = "PaymentIntentHandler";
    string private constant _VERSION = "1";

    constructor() {
        (
            _EIP_712_DOMAIN_TYPEHASH,
            _PAYMENT_INTENT_TYPEHASH
        ) = _createTypeHashes();
    }

    function _createTypeHashes()
        internal
        pure
        returns (bytes32 eip712DomainTypehash, bytes32 paymentIntentTypehash)
    {
        eip712DomainTypehash = keccak256(
            abi.encodePacked(
                "EIP712Domain(",
                "string name,",
                "string version,",
                "uint256 chainId,",
                "address verifyingContract",
                ")"
            )
        );

        bytes memory paymentIntentTypestring = abi.encodePacked(
            "PaymentIntent(",
            "uint256 amount,",
            "uint256 feeBps,",
            "address feeRecipient,",
            "address merchant,",
            "uint256 salt,",
            "uint8 quantityType,",
            "uint256 quantity,",
            "uint8 signerType,",
            "address signer,",
            "uint256 nonce",
            ")"
        );

        paymentIntentTypehash = keccak256(paymentIntentTypestring);
    }

    function _hashDomain(
        bytes32 eip712DomainTypehash,
        bytes32 nameHash,
        bytes32 versionHash
    ) internal view returns (bytes32) {
        uint256 chainId;
        assembly {
            chainId := chainid()
        }
        return
            keccak256(
                abi.encode(
                    eip712DomainTypehash,
                    nameHash,
                    versionHash,
                    chainId,
                    address(this)
                )
            );
    }

    function _hashPaymentIntent(
        PaymentIntent memory intent
    ) internal view returns (bytes32) {
        return
            keccak256(
                abi.encode(
                    _PAYMENT_INTENT_TYPEHASH,
                    intent.amount,
                    intent.feeBps,
                    intent.feeRecipient,
                    intent.merchant,
                    intent.salt,
                    intent.quantityType,
                    intent.quantity,
                    intent.signerType,
                    intent.signer,
                    intent.nonce
                )
            );
    }

    function _hashToSign(bytes32 hash) internal view returns (bytes32) {
        bytes32 domain = _hashDomain(
            _EIP_712_DOMAIN_TYPEHASH,
            keccak256(bytes(_NAME)),
            keccak256(bytes(_VERSION))
        );

        return keccak256(abi.encodePacked(bytes2(0x1901), domain, hash));
    }

    function _verifySignature(
        bytes32 _hash,
        address signer,
        bytes memory signature
    ) internal {
        bytes32 r;
        bytes32 s;
        uint8 v;
        bytes memory sigToValidate;

        bytes32 hashToSign = _hashToSign(_hash);

        // The order here is strictly defined in https://eips.ethereum.org/EIPS/eip-6492
        // - ERC-6492 suffix check and verification first, while being permissive in case
        //   the contract is already deployed; if the contract is deployed we will check
        //   the sig against the deployed version, this allows 6492 signatures to still
        //   be validated while taking into account potential key rotation
        // - ERC-1271 verification if there's contract code
        // - finally, ecrecover

        bool isCounterfactual = _extractSuffix(signature) ==
            _ERC6492_DETECTION_SUFFIX;

        if (isCounterfactual) {
            address create2Factory;
            bytes memory factoryCalldata;

            bytes memory payload = _sliceSignaturePayload(signature);
            (create2Factory, factoryCalldata, sigToValidate) = abi.decode(
                payload,
                (address, bytes, bytes)
            );

            // solhint-disable-next-line explicit-types
            uint contractCodeLen = _getCodeAt(signer).length;
            if (contractCodeLen == 0) {
                // solhint-disable-next-line avoid-low-level-calls
                (bool success, bytes memory err) = create2Factory.call(
                    factoryCalldata
                );
                if (!success) {
                    revert(
                        string(abi.encodePacked("ERC6492DeployFailed: ", err))
                    );
                }
            }
        } else {
            sigToValidate = signature;
        }

        if (_getCodeAt(signer).length > 0) {
            bytes4 magicValue = IERC1271(signer).isValidSignature(
                hashToSign,
                sigToValidate
            );

            if (magicValue != IERC1271(signer).isValidSignature.selector) {
                revert("InvalidSignature");
            }

            return;
        }

        // solhint-disable-next-line
        assembly {
            r := mload(add(signature, 32))
            s := mload(add(signature, 64))
            v := byte(0, mload(add(signature, 96)))
        }

        _verify(signer, hashToSign, v, r, s);
    }

    /**
     * @notice Verify signature of digest
     * @param signer Address of expected signer
     * @param digest Signature digest
     * @param v v parameter
     * @param r r parameter
     * @param s s parameter
     */
    function _verify(
        address signer,
        bytes32 digest,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) internal pure {
        if (v != 27 && v != 28) {
            revert("InvalidVParameter");
        }

        address recoveredSigner = ecrecover(digest, v, r, s);
        if (recoveredSigner == address(0) || signer != recoveredSigner) {
            revert("InvalidSignature");
        }
    }

    function _getCodeAt(
        address _addr
    ) internal view returns (bytes memory code) {
        assembly {
            // Get the size of the code at address _addr
            let size := extcodesize(_addr)
            // Allocate output byte array
            code := mload(0x40)
            // Store the size at the beginning of the memory for the bytes array
            mstore(code, size)
            // Get the actual code
            extcodecopy(_addr, add(code, 0x20), 0, size)
            // Update free-memory pointer
            mstore(0x40, add(code, add(size, 0x20)))
        }
    }

    function _extractSuffix(
        bytes memory signature
    ) internal pure returns (bytes32 suffix) {
        require(signature.length >= 32, "Signature too short");
        assembly {
            // mload reads 32 bytes starting at the given pointer
            // signature points to length, so data starts at add(signature, 32)
            suffix := mload(add(signature, add(32, sub(mload(signature), 32))))
        }
    }

    function _sliceSignaturePayload(
        bytes memory signature
    ) internal pure returns (bytes memory) {
        require(signature.length > 32, "Signature too short for 6492 suffix");

        uint256 newLength = signature.length - 32;
        bytes memory sliced = new bytes(newLength);

        for (uint256 i = 0; i < newLength; i++) {
            sliced[i] = signature[i];
        }

        return sliced;
    }
}

